import React, {Component} from 'react';
import {Container, Navbar} from "react-bootstrap";

class Header extends Component {
    render() {
        return (
            <>
                <Navbar>
                    <Container>
                        <Navbar.Brand href="/"></Navbar.Brand>
                    </Container>
                </Navbar>
            </>
        );
    }
}

export default Header;
